import React from "react"

class Formitem extends React.Component{
  render() {
    return (
      <div className={this.props.cName}>
        <label for={this.props.label.for}>
          <b>{this.props.label.title}</b>
        </label>
        <input type={this.props.input.type} className={this.props.input.cName} placeholder={this.props.input.placeholder} name={this.props.input.name} />
      </div>
    )
  }
}
export default Formitem
